const uint8_t FRAMES_COUNT = sizeof(video) / sizeof(video[0]);

uint8_t currentFrame = 0;





/* ===== SETUP ===== */
void setup() {
  Wire.begin();

  if (!display.begin(SSD1306_SWITCHCAPVCC, OLED_ADDR)) {
    for (;;); // если дисплей не завёлся — всё, приехали
  }

  display.clearDisplay();
  display.invertDisplay(true); // если не нужно — убери
  display.display();
}

/* ===== LOOP ===== */
void loop() {
  display.clearDisplay();

  const uint8_t* frame =
    (const uint8_t*)pgm_read_ptr(&video[currentFrame]);

  display.drawBitmap(
    0, 0,
    frame,
    SCREEN_WIDTH,
    SCREEN_HEIGHT,
    SSD1306_WHITE
  );

  display.display();

  currentFrame++;
  if (currentFrame >= FRAMES_COUNT) {
    currentFrame = 0;
  }

  delay(60); // ~16 FPS
}